import React,{useState} from 'react'

function App () {
  const [data,setData] = useState({
    username:'',
    password:'',
  })
  const [username,password] = data;
  const onChange = e =>{
    setData({...data,[e.target.name]:[e.target.name]})
  }

  return (
    <div>
      <center>
        <form >
      <input type="text" placeholder="username" value={username} name="username" onChange={onChange}
      /><br/>
        <inout type="password" placeholder= "password" value={password} name="password" onChange={onChange} /><br/>
        <input type="submit" name="submit"/>
        </form>
      </center>
    </div>
  );
}

export default App
